import React from 'react';
import NavBar from '../NavBar';
import Footer from '../Footer';
import Card from 'react-bootstrap/Card'
import { Container, Row, Col } from 'react-bootstrap';
import Molly from ''





function AdoptableDog(){
    let dogs = [
        {
            "name":"Molly",
            "image":"https://images.pexels.com/photos/825949/pexels-photo-825949.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
            "breed":"Domestic",
            "age":"4 years",
            "sex":"male"
        },
        {
            "name":"Holly",
            "image":"https://images.pexels.com/photos/825949/pexels-photo-825949.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },
        {
            "name":"Dolly",
            "image":"https://images.pexels.com/photos/2007/animal-dog-pet-cute.jpg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },
        {
            "name":"Lolly",
            "image":"https://images.pexels.com/photos/731022/pexels-photo-731022.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },

    ]


    function ClickMe(){
        return <Molly/>
    }

    return (
    <div>
    <NavBar/>
    <div>
    <img className="firstImage" src="https://images.pexels.com/photos/2252311/pexels-photo-2252311.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"/></div>
        <header className="adopt-cat-title"><h1>Adoptable Dogs</h1></header>
        <div className="adopt-cat-text">Meet our adoptable dogs! All these dogs have been rescued and are ready to join your family. 
</div>
<div className="adopt-cat-cards">
<p>All of these cats are individuals and have their own stories, interests, and personalities. Please read their bios and browse their photos and let us know if we can help you find the one that’s right for you. All of our cats have been given a comprehensive exam by a veterinarian. They have been vaccinated, neutered or spayed, FIV/Felv, and microchipped. Any additional medical info is listed in their bios.</p>
<Row xs={1} md={3} className="g-4">
  {dogs.map((dog, idx) => (
    <Col>
      <Card onClick={ClickMe}>
        <Card.Img variant="top" src={dog.image} />
        <Card.Body>
          <Card.Title>{dog.name}</Card.Title>
          <Card.Text>Breed:{dog.breed}</Card.Text>
          <Card.Text>Age:{dog.age}</Card.Text>
          <Card.Text>Sex:{dog.sex}</Card.Text>

        </Card.Body>
      </Card>
    </Col>
  ))}
</Row>

</div>
<div className="adoption-process"><h1>
    Adoption Process
</h1>
<p>Our adoption process is people friendly and we welcome the opportunity to work with people looking to adopt. Our adoption process consists of a short application and a meet where you can get to know the animal you are interested in. Once you find the perfect match, we ask adopters to sign an adoption contract and give a donation to help us rescue the next animal in need. We process applications in the order in which they were received. By providing comprehensive behavioral information about the animal and gathering relevant information about the prospective home environment, we work with each applicant to match them with a compatible animal.</p></div>

        <Footer/>

    </div>
    )
}
export default AdoptableDog;
